import React from "react";
import "./endFooter.css";

const EndFooter = (props) => {
  return (
    <div className=" col_endfooter">
      <ul>
        {props.item.map((item) => (
          <li>{item}</li>
        ))}
      </ul>
    </div>
  );
};
export default EndFooter;
